import styled from "styled-components";
import MainPicDummy from "../../../dummyResources/MainPicDummy.jpg";
import HeaderPic from "./HeaderPic";

interface Props {}

const SHeader = styled.div`
  width: 100%;
  position: relative;
`;

const HeaderText = styled.div`
  color: white;
  position: absolute;
  bottom: 0%;
  left: 5%;
  width: 60%;
  transform: translateY(0);
`;

const HeaderTextHeading = styled.h3`
  padding-bottom: 11px;
  border-bottom: 1px solid white;
  font-size: 20px;
  font-weight: 800;
`;

const HeaderTextDescription = styled.p`
  margin-top: 8px;
  font-size: 10px;
  font-weight: 500;
`;

export default function Header(props: Props) {
  return (
    <SHeader>
      <HeaderPic src={MainPicDummy} />
      <HeaderText>
        <HeaderTextHeading>친구들과 놀러가요!</HeaderTextHeading>
        <HeaderTextDescription>
          취향이 통하는 대학친구들과 즐기는 공간
        </HeaderTextDescription>
      </HeaderText>
    </SHeader>
  );
}
